import styled from "styled-components"

export const Header = styled.header `
    display: flex;
    justify-content: space-between;
    width: 100%;
    background-color: #e17366;
`;

export const Container = styled.div `
    display: flex;
    /*justify-content: center;
    align-items: center;*/
`;

export const Logo = styled.div `
    font-size: 30px;
    color: #fff;
    font-weight: bold;
    margin: 25px;
    display: flex;
    justify-content: center;
    align-items: center;
`;

export const Ul = styled.ul `
    display: flex;
    font-weight: bold;
    margin: 35px;
`;

export const Li = styled.li `
    display: flex;
    color: white;
    font-size: 25px;
    text-decoration: none;
    margin: 30px 15px; 
    text-decoration: none;
`;

export const StyledLink = styled.div `
    text-decoration: none;
    color: white;
    cursor: pointer;
    &:hover, &:focus {
        color: #1b5ff9;
        transition: 400ms;
    }
`;

export const StyledH3 = styled.h3 `
    text-decoration: none;
    color: white;
    &:hover, &:focus {
        color: #1b5ff9;
        transition: 400ms;
    }
`;

export const Div = styled.div `
    margin: 35px 0;
    font-size: 25px;
    font-weight: bold;
    color: #fff;
    fontWeight: 'bold';
`;
